import (
	context "context"
	fern "github.com/multi-url-environment-no-default/fern"
	fernclient "github.com/multi-url-environment-no-default/fern/client"
	option "github.com/multi-url-environment-no-default/fern/option"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
	option.WithBaseURL(
		fern.Environments.Production,
	),
)
err := client.Ec2.BootInstance(
	context.TODO(),
	&fern.BootInstanceRequest{
		Size: "string",
	},
)

